def calculate_comparison_score(list1, list2):
    """
    Calculate score based on element frequency comparison between two lists
    
    Parameters:
    - list1: First list to compare
    - list2: Second list to compare
    
    Returns:
    - Dictionary containing:
      * Individual element scores
      * Total score
      * Frequency details
    """
    # Count frequency of elements in list2
    list2_freq = {}
    for item in list2:
        list2_freq[item] = list2_freq.get(item, 0) + 1
    
    # Calculate scores for each element in list1
    scores = {}
    total_score = 0
    
    for item in list1:
        # Check frequency of item in list2
        frequency = list2_freq.get(item, 0)
        
        # Calculate score (item * frequency)
        item_score = item * frequency
        
        # Store individual scores
        scores[item] = {
            'value': item,
            'frequency': frequency,
            'score': item_score
        }
        
        # Add to total score
        total_score += item_score
    
    return {
        'individual_scores': scores,
        'total_score': total_score,
        'list1_length': len(list1),
        'list2_length': len(list2)
    }

